$(document).ready(function(){$(".entry-content").fitVids(),$('[title!=""]').qtip(),$(".slider").fractionSlider({fullWidth:!0,controls:!0,pager:!0,responsive:!0,dimensions:"1100,400",increase:!1,pauseOnHover:!0,slideEndAnimation:!0})}),$(window).scroll(function(){$(this).scrollTop()>100?$(".scrollup").fadeIn():$(".scrollup").fadeOut()}),$(".scrollup").click(function(){return $("html, body").animate({scrollTop:0},600),!1});